document.addEventListener("DOMContentLoaded",(function(){let e=document.querySelector(".calculate__width").value,t=document.querySelector(".calculate__height").value,u=document.querySelector(".calculate__result");document.querySelector(".calculate__button").addEventListener("click",(function(){const c=Math.round(Math.sqrt(Number(t)/(Number(e)/1.7))),n=Math.round(Number(t)/c);u.innerHTML=n}))}));